import React from 'react'
import './Sponsor.css'

import pottoLogo from "/Users/enrico/Desktop/cobras_fixed/src/DJ-Potto.jpg"
import doc from "/Users/enrico/Desktop/cobras_fixed/src/DOC.jpg"

const sponsors = [
  {
    name: "Djpotto",
    logo: pottoLogo,
    link: "https://www.instagram.com/_djpotto_/",
  },
  {
    name: "Doc",
    logo: doc,
    link: "https://docpizzeriaalbino.it",
  },
  {
    name: "Performance",
    logo: "/Users/enrico/Desktop/cobras_fixed/src/PERFORMANCE365.jpg",
    link: "https://www.performance365.it",
  },
  {
    name: "Moioli",
    logo: "/Users/enrico/Desktop/cobras_fixed/src/PREFABBRICATI-MOIOLI.jpg",
    link: "https://prefabbricatimoioli.it",
  },
];


const Sponsor = () => {
  return (
      <div className="sponsor-container">
      <h1 className="sponsor-title">I Nostri Sponsor</h1>
      <div className="sponsor-grid">
        {sponsors.map((sponsor, index) => (
          <a
            key={index}
            href={sponsor.link}
            target="_blank"
            rel="noopener noreferrer"
            className="sponsor-card"
          >
            <img
              src={sponsor.logo}
              alt={sponsor.name}
              className="sponsor-logo"
            />
          </a>
        ))}
      </div>
    </div>
  )
}

export default Sponsor
